import React, {useEffect} from 'react';
import axios from 'axios';

function App() {
    const callApi = async () => {
        axios.get('/api').then((res) => console.log(res));
    };

    useEffect(() => {
        callApi();
    }, []);
  return (
    <div className="App">
      <button>서버 정보 출력</button>
    </div>
  );
}

export default App;
